import React from 'react';
import './Input.css';


function Input(props) {
    return (
        <form id="Input"> 
            <textarea placeholder="Place notations here..." value={props.value} onChange={props.updateNotation} autoCorrect="false" />
            <input type="submit" value="Parse" onClick={props.parseNotations} />
        </form>
    );
}

export default Input;
